import React from "react";
import Card from "./Card";
import contacts from "../contacts";

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <Card
      name={contacs[0].name}
      imgURL={contacts[0].imgURL}
      phone={contacs[0].phone}
      email={contacs[0].email}
      />
    </div>
  );
}

export default App;
